import React from "react";
import "../style/navbar.css";

class Navbar extends React.Component {
    render() {
        return (
           <div className="navbar">
               <div>
                <button>Home</button>
                <button>About</button>
                <button>Donate</button>
                <button>My Profile</button>
               </div>
           </div> 
        );
    }
}

export default Navbar;
